import React, {useEffect, useState} from 'react';
import Recipe from "./Recipe";
import Navbar from "./Navbar";
import Navigation from "./Navigation";
import Vegan from "./Vegan";
import ItemDetail from './ItemDetail';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import About from './About';
import './App.css';

//function component const example = (props) => { return <div /> }
const App = () => {

  return (
    <Router>
    <div className="App">
      <Navigation/>
      <Switch>
        <Route path="/" exact component={App} />
        <Route path="/about" component={About} />
        <Route path="/vegan" component={Vegan} />
        {/* 
        <Route path="/healthy" component={Healthy} />
        /<Route path="/baking" component={Baking} />
        /<Route path="/christmas" component={Christmas} /> 
        */}
        <Route path="/recipe/:id" component={ItemDetail} />
      </Switch>
      

      <div className="recipes">
        {recipes.map(recipe => (
          <Recipe 
          title={recipe.recipe.label} 
          calories={recipe.recipe.calories}
          image={recipe.recipe.image}
          ingredients={recipe.recipe.ingredients} />
        ))}
      </div>
    </div>
    </Router>
  );
}

export default App;
